    "text": "至今為止，我都覺得 RSS/Atom 訂閱沒有任何替代方案，因為它完全能以讀者自己為中心，全盤掌控讀什麼、何時讀、用什麼讀。即使是只供應部分內文，也有資訊更新與提醒的用意。\n\n它像一條自己挑選源頭、匯集而成的安靜河流，與湍急又難以預測的社群網站截然不同。",
