    "id": 876244846821781504,
    "id_str": "876244846821781504",
    "text": "回想起小時候的報紙，看副刊連載、找電影上映片單、找工作、股票資訊⋯⋯，其實是個複合資訊提供者；一般人翻翻時事頭條的需求也被谷歌新聞匯總頁滿足了。\n\n報紙曾經就是網路，如今被分散替代了，付費閱讀深度新聞的狹義讀者群，本來就沒有那麼多（雖然比現在多），誤讀TA量體可能會很失望。",
